import React, {Component} from 'react'
import Modal from 'react-modal'

export default class Board extends Component {
    customStyles = {
        content : {
            top                   : '50%',
            left                  : '50%',
            right                 : 'auto',
            bottom                : 'auto',
            marginRight           : '-50%',
            transform             : 'translate(-50%, -50%)'
        }}


     
    render() {
        return (
            <div className="RCA-board-container">

                <button className="RCA-board-button" >편집</button>
                <h3>공지사항</h3>
            </div>
        )
    }
}
